CREATE TABLE IF NOT EXISTS `licenciamiento` (
  `Pk_Id_Licencia` int(11) NOT NULL AUTO_INCREMENT,
  `Fk_Id_Entidad` int(11) DEFAULT NULL,
  `Tipo_Licencia` int(11) DEFAULT NULL COMMENT '360: Anual; 30: Mensual; NULL: Gratuita',
  `Fecha_Inicio` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `Valor` decimal(10,0) DEFAULT '0',
  PRIMARY KEY (`Pk_Id_Licencia`)
) ENGINE=InnoDB  DEFAULT CHARSET=latin1 AUTO_INCREMENT=2181 ;

